import React from 'react';
import './App.css';
import {Link, BrowserRouter, Switch} from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
      <div className="pushable">
        <div className="ui container">
          <div className="ui main menu">
              <a className="item">
                <Link to="/">Home</Link>
              </a>
              <a className="item">
                <Link to="/about">About</Link>
              </a>
              <a className="item">
                <Link to="/users">Users</Link>
              </a>
          </div>

          {/* A <Switch> looks through its children <Route>s and
              renders the first one that matches the current URL. */}
          <Switch>
            <BrowserRouter path="/about">
              <About />
            </BrowserRouter>
            <BrowserRouter path="/users">
              <Users />
            </BrowserRouter>
            <BrowserRouter path="/">
              <Home />
            </BrowserRouter>
          </Switch>
        </div>
      </div>
    </BrowserRouter>
  );
}

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}

export default App;
